import Storage from './storage';
class Home extends React.Component {
  state={
    lastname:"ffc",
    employeeid:"ff",
    email:"ff",
    phno:"ff",

  }
  changename=(event)=>{
     alert(event.target.value)
  }
    render() {
      return (
        <div className="to-do-list-main">
          <table>

            <tr>
              <th><input value={this.state.lastname} onChange={this.changename}></input></th>
              <th><input value={this.state.employeeid}></input></th>
              <th><input value={this.state.email}></input></th>
              <th><input value={this.state.phno}></input></th>

            </tr>

          </table>


        </div>


      );
    }
  }

export default Home;
